    true,nt"url": null,nt"notes": "The Historical Ambient Air Quality Data
    Inventory contains measured and estimated data on ambient air pollution for use
    in assessing air quality, assisting in designating attainment/non-attainment areas,
    evaluating state implementation plans for non-attainment areas, performing modeling
    for permit review analysis, and other air quality functionsThe statutory authority
    leading to the collection of this information comes from Title I, Part A of the
     Clean Air Act. Sustance classes include Criteria Air Pollutants, Hazardous Air
    Pollutants, and Greenhouse Gases. Data no longer collected, current Ambient Air
    Quality Data Inventory uses higher geographic density and more robust methods of
    measurement.",nt"license_title": "Other License Specified",nt"extras":
